width: 100%;
display:flex;
justify-content: space-between;


    @media (min-width: 1px) and (max-width: 426px) {
      flex-direction: column;

      }
`

const FormHolder = styled.form`
margin: 0 auto

`

const Input = styled.input`
width: 100%;

`

class Form extends Component {
  componentDidMount(){
    AOS.init({
      duration : 1000
    })
  }
render() {

    return (

      <Container id="Home">
            <FormHolder action="">
